const Component4 = (props) => {
  console.log("props of Component 4", props);

  //Destructing
  const { nameprop, ageprop } = props;
  console.log("nameprop and ageprop of Component 4", nameprop, ageprop);

  return (
    <div>
      <h2>Component 4</h2>
      <p>{"Hey, my name is ${nameprop} and age is ${ageprop}"}</p>
    </div>
  );
};
export default Component4;
